import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import {DropdownButton, Dropdown} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';

import * as NavigationLinks from "./NavigationLinks";

class TopNavigationBar extends Component {
    render() {
        return (
            <Router>
                <div>
                    <nav>
                        <ul>
                            {NavigationLinks.mainPageLinks.map(link => (
                                <li><Link to={link.endpoint}>{link.name}</Link></li>))}
                            <li>
                                <ServiceDropDownMenu/>
                            </li>
                        </ul>
                    </nav>
                    <Switch>
                        {NavigationLinks.allLinks.map(link => (
                            <Route exact path={link.endpoint} component={link.page}/>))}
                    </Switch>
                </div>
            </Router>
        );
    }
}

class ServiceDropDownMenu extends Component {
    render() {
        return (
            <DropdownButton title="Services">
                {NavigationLinks.serviceDropDownMenuPageLinks.map(link => (
                    <Dropdown.Item href={link.endpoint}>{link.name}</Dropdown.Item>))}
            </DropdownButton>
        );
    }
}

export default TopNavigationBar;
